SET NOCOUNT ON;
IF OBJECT_ID(N'User_Wallet', N'U') IS NOT NULL DROP TABLE User_Wallet;
CREATE TABLE User_Wallet (
    User_Id INT NOT NULL,
    User_Point INT NOT NULL
);

IF OBJECT_ID(N'UserSignInStats', N'U') IS NOT NULL DROP TABLE UserSignInStats;
CREATE TABLE UserSignInStats (
    LogID INT NOT NULL,
    SignTime DATETIME2 NOT NULL,
    UserID INT NOT NULL,
    PointsGained INT NOT NULL,
    PointsGainedTime DATETIME2 NOT NULL,
    ExpGained INT NOT NULL,
    ExpGainedTime DATETIME2 NOT NULL,
    CouponGained VARCHAR(50) NOT NULL,
    CouponGainedTime DATETIME2 NOT NULL
);

IF OBJECT_ID(N'Pet', N'U') IS NOT NULL DROP TABLE Pet;
CREATE TABLE Pet (
    PetID INT NOT NULL,
    UserID INT NOT NULL,
    PetName NVARCHAR(50) NOT NULL,
    Level INT NOT NULL,
    LevelUpTime DATETIME2 NOT NULL,
    Experience INT NOT NULL,
    Hunger INT NOT NULL,
    Mood INT NOT NULL,
    Stamina INT NOT NULL,
    Cleanliness INT NOT NULL,
    Health INT NOT NULL,
    SkinColor VARCHAR(10) NOT NULL,
    SkinColorChangedTime DATETIME2 NOT NULL,
    BackgroundColor NVARCHAR(50) NOT NULL,
    BackgroundColorChangedTime DATETIME2 NOT NULL,
    PointsChanged_SkinColor INT NOT NULL,
    PointsChanged_BackgroundColor INT NOT NULL,
    PointsGained_LevelUp INT NOT NULL,
    PointsGainedTime_LevelUp DATETIME2 NOT NULL
);

IF OBJECT_ID(N'MiniGame', N'U') IS NOT NULL DROP TABLE MiniGame;
CREATE TABLE MiniGame (
    PlayID INT NOT NULL,
    UserID INT NOT NULL,
    PetID INT NOT NULL,
    Level INT NOT NULL,
    MonsterCount INT NOT NULL,
    SpeedMultiplier DECIMAL(5,2) NOT NULL,
    Result NVARCHAR(10) NOT NULL,
    ExpGained INT NOT NULL,
    ExpGainedTime DATETIME2 NOT NULL,
    PointsGained INT NOT NULL,
    PointsGainedTime DATETIME2 NOT NULL,
    CouponGained VARCHAR(50) NOT NULL,
    CouponGainedTime DATETIME2 NOT NULL,
    HungerDelta INT NOT NULL,
    MoodDelta INT NOT NULL,
    StaminaDelta INT NOT NULL,
    CleanlinessDelta INT NOT NULL,
    StartTime DATETIME2 NOT NULL,
    EndTime DATETIME2 NULL,
    Aborted BIT NOT NULL
);

IF OBJECT_ID(N'CouponType', N'U') IS NOT NULL DROP TABLE CouponType;
CREATE TABLE CouponType (
    CouponTypeID INT NOT NULL,
    Name NVARCHAR(100) NOT NULL,
    DiscountType NVARCHAR(10) NOT NULL,
    DiscountValue DECIMAL(10,2) NOT NULL,
    MinSpend DECIMAL(10,2) NOT NULL,
    ValidFrom DATETIME2 NOT NULL,
    ValidTo DATETIME2 NOT NULL,
    PointsCost INT NOT NULL,
    Description NVARCHAR(255) NULL
);

IF OBJECT_ID(N'Coupon', N'U') IS NOT NULL DROP TABLE Coupon;
CREATE TABLE Coupon (
    CouponID INT NOT NULL,
    CouponCode VARCHAR(20) NOT NULL,
    CouponTypeID INT NOT NULL,
    UserID INT NOT NULL,
    IsUsed BIT NOT NULL,
    AcquiredTime DATETIME2 NOT NULL,
    UsedTime DATETIME2 NULL,
    UsedInOrderID INT NULL
);

IF OBJECT_ID(N'EVoucherType', N'U') IS NOT NULL DROP TABLE EVoucherType;
CREATE TABLE EVoucherType (
    EVoucherTypeID INT NOT NULL,
    Name NVARCHAR(100) NOT NULL,
    ValueAmount DECIMAL(10,2) NOT NULL,
    ValidFrom DATETIME2 NOT NULL,
    ValidTo DATETIME2 NOT NULL,
    PointsCost INT NOT NULL,
    TotalAvailable INT NOT NULL,
    Description NVARCHAR(255) NULL
);

IF OBJECT_ID(N'EVoucher', N'U') IS NOT NULL DROP TABLE EVoucher;
CREATE TABLE EVoucher (
    EVoucherID INT NOT NULL,
    EVoucherCode VARCHAR(50) NOT NULL,
    EVoucherTypeID INT NOT NULL,
    UserID INT NOT NULL,
    IsUsed BIT NOT NULL,
    AcquiredTime DATETIME2 NOT NULL,
    UsedTime DATETIME2 NULL
);

IF OBJECT_ID(N'EVoucherToken', N'U') IS NOT NULL DROP TABLE EVoucherToken;
CREATE TABLE EVoucherToken (
    TokenID INT NOT NULL,
    EVoucherID INT NOT NULL,
    Token VARCHAR(64) NOT NULL,
    ExpiresAt DATETIME2 NOT NULL,
    IsRevoked BIT NOT NULL
);

IF OBJECT_ID(N'EVoucherRedeemLog', N'U') IS NOT NULL DROP TABLE EVoucherRedeemLog;
CREATE TABLE EVoucherRedeemLog (
    RedeemID INT NOT NULL,
    EVoucherID INT NOT NULL,
    TokenID INT NULL,
    UserID INT NOT NULL,
    ScannedAt DATETIME2 NOT NULL,
    Status NVARCHAR(20) NOT NULL
);

IF OBJECT_ID(N'WalletHistory', N'U') IS NOT NULL DROP TABLE WalletHistory;
CREATE TABLE WalletHistory (
    LogID INT NOT NULL,
    UserID INT NOT NULL,
    ChangeType NVARCHAR(10) NOT NULL,
    PointsChanged INT NOT NULL,
    ItemCode VARCHAR(50) NULL,
    Description NVARCHAR(255) NULL,
    ChangeTime DATETIME2 NOT NULL
);











